Noch ein Bild von unserem Ausflug zu den Altschlossfelsen und das war definitiv nicht das letzte 😍 Die Bilder dort sind so schön geworden und haben alle so etwas magisches an sich, würde sie am liebsten alle hochladen 😇 
Ich hab den Tag heute dazu genutzt für eine Prüfung in 1 1/2 Wochen zu lernen und meine Sachen zu packen ☺️ Morgen geht es nämlich für mich in meinen Studienort, weil mein bester Freund heiratet 😍😭 Ich freue mich so unfassbar auf morgen, meinen besten Freund und seine Frau endlich wiederzusehen und einfach mit beiden den schönsten Tage ihres Lebens zu verbringen 😍 Und gleichzeitig bin ich mir sicher, dass ich bei der Trauung weinen werde wie ein Schlosshund 🙏🏻 Bin bei sowas einfach immer sehr emotional 🙈 Wie ist das bei euch ? Müsst ihr bei romantischen Dingen auch immer weinen ? 😂💗
